51986830495754876	/opt/airflow/dags/simple_test_dag.py	2025-07-21 12:31:27.509827+00	"""\n简化的测试DAG，用于验证模块导入\n"""\n\nimport sys\nimport os\nfrom datetime import datetime, timedelta\nfrom airflow import DAG\nfrom airflow.decorators import dag, task\nimport logging\n\n# 添加src目录到Python路径\nsys.path.append('/opt/airflow/src')\n\nlogger = logging.getLogger(__name__)\n\n# DAG配置\ndefault_args = {\n    'owner': 'ai-team',\n    'depends_on_past': False,\n    'start_date': datetime(2024, 1, 1),\n    'email_on_failure': False,\n    'email_on_retry': False,\n    'retries': 1,\n    'retry_delay': timedelta(minutes=5),\n}\n\n@dag(\n    dag_id='simple_test_workflow',\n    default_args=default_args,\n    description='简化的测试工作流',\n    schedule=None,\n    catchup=False,\n    tags=['test', 'simple']\n)\ndef simple_test_dag():\n    """\n    简化的测试DAG\n    """\n    \n    @task(task_id='test_import')\n    def test_import():\n        """测试模块导入"""\n        try:\n            # 测试导入\n            from src.core_workflow import get_and_lock_job\n            logger.info("✅ 成功导入 core_workflow 模块")\n            \n            from src.database import db_manager\n            logger.info("✅ 成功导入 database 模块")\n            \n            from src.image_generator import ImageGenerator\n            logger.info("✅ 成功导入 image_generator 模块")\n            \n            return "所有模块导入成功"\n            \n        except ImportError as e:\n            logger.error(f"❌ 模块导入失败: {e}")\n            raise\n        except Exception as e:\n            logger.error(f"❌ 其他错误: {e}")\n            raise\n    \n    @task(task_id='test_database')\n    def test_database():\n        """测试数据库连接"""\n        try:\n            from src.database import db_manager\n            \n            # 测试数据库连接\n            with db_manager.get_connection() as conn:\n                with conn.cursor() as cursor:\n                    cursor.execute("SELECT 1")\n                    result = cursor.fetchone()\n                    if result and result[0] == 1:\n                        logger.info("✅ 数据库连接测试成功")\n                        return "数据库连接正常"\n                    else:\n                        raise Exception("数据库连接测试失败")\n                        \n        except Exception as e:\n            logger.error(f"❌ 数据库测试失败: {e}")\n            raise\n    \n    # 定义任务流程\n    import_test = test_import()\n    db_test = test_database()\n    \n    # 设置任务依赖\n    import_test >> db_test\n\n# 创建DAG实例\nsimple_dag = simple_test_dag() 
57622103943375835	/opt/airflow/dags/test_image_generation_dag.py	2025-07-21 08:17:05.743688+00	"""\n⚠️ 测试图像生成DAG ⚠️\n\n此DAG仅用于测试目的，使用低成本的文本到图像模型。\n生成的数据标记为"测试数据"，便于清理。\n\n重要警告：\n- 此DAG仅用于开发和测试环境\n- 使用低成本模型，生成质量可能较低\n- 生成的文件会自动标记为测试数据\n- 请勿在生产环境中使用此DAG\n"""\n\nimport sys\nimport os\nfrom datetime import datetime, timedelta\nfrom airflow import DAG\nfrom airflow.decorators import dag, task\nimport logging\n\n# 添加src目录到Python路径\nsys.path.append('/opt/airflow/src')\n\nlogger = logging.getLogger(__name__)\n\n\n\n# DAG配置\ndefault_args = {\n    'owner': 'ai-team',\n    'depends_on_past': False,\n    'start_date': datetime(2024, 1, 1),\n    'email_on_failure': False,\n    'email_on_retry': False,\n    'retries': 1,\n    'retry_delay': timedelta(minutes=5),\n}\n\n# DAG文档\ndag_doc = """\n# 测试图像生成工作流\n\n## ⚠️ 重要警告 ⚠️\n\n**此DAG仅用于测试目的！**\n\n### 使用说明：\n- 此DAG使用低成本的文本到图像模型\n- 生成的文件会自动标记为测试数据（文件名包含`_image_test`）\n- 生成的数据质量可能较低，仅用于验证工作流程\n- 请勿在生产环境中使用此DAG\n\n### Dry Run模式（默认）：\n- **默认启用**：Dry Run模式默认开启，确保零API成本\n- **占位符文件**：创建`.txt`占位符文件而不是真实图像\n- **完整测试**：验证所有数据库操作、任务依赖和文件I/O\n- **安全第一**：防止意外API调用和成本产生\n\n### 真实模式：\n- 手动关闭Dry Run开关以启用真实API调用\n- 生成真实的`.png`图像文件\n- 会产生Google Vertex AI API成本\n- 仅用于最终测试和验证\n\n### 工作流程：\n1. 从数据库获取待处理的IMAGE_TEST类型作业\n2. 根据Dry Run设置决定是否调用API\n3. 保存图像或占位符文件到本地outputs目录\n4. 更新作业状态为完成\n\n### 清理：\n- 测试文件会在24小时后自动清理\n- 可以通过手动触发清理任务来立即清理旧文件\n\n### 注意事项：\n- 确保Google Cloud凭据已正确配置\n- 确保数据库连接正常\n- 监控生成的文件大小和存储空间\n- **重要**：Dry Run模式默认开启，确保测试安全\n"""\n\n@dag(\n    dag_id='image_generation_test_workflow',\n    default_args=default_args,\n    description='测试图像生成工作流 - 仅用于测试目的',\n    schedule=None,  # 手动触发\n    catchup=False,\n    tags=['test', 'image-generation', 'development'],\n    doc_md=dag_doc,\n    max_active_runs=1,  # 限制并发运行\n    concurrency=1,\n    params={\n        "dry_run": {\n            "type": "boolean",\n            "default": False,\n            "title": "Dry Run Mode",\n            "description": "If True, skips the actual API call and creates a placeholder file. Set to False for real API calls."\n        }\n    }\n)\ndef test_image_generation_dag():\n    """\n    测试图像生成DAG\n    \n    此DAG仅用于测试目的，使用低成本的文本到图像模型。\n    生成的数据标记为"测试数据"，便于清理。\n    """\n    \n    # 在DAG函数内部导入模块\n    try:\n        from core_workflow import get_and_lock_job, mark_job_as_completed, mark_job_as_failed\n        from image_generator import image_generator\n        from database import db_manager\n    except ImportError as e:\n        logger.error(f"导入模块失败: {e}")\n        raise\n    \n    @task(task_id='initialize_database')\n    def initialize_database():\n        """初始化数据库表结构"""\n        try:\n            db_manager.init_database()\n            logger.info("数据库初始化完成")\n            return "数据库初始化成功"\n        except Exception as e:\n            logger.error(f"数据库初始化失败: {e}")\n            raise\n    \n    @task(task_id='get_job_task')\n    def get_job_task():\n        """获取并锁定一个待处理的测试图像作业"""\n        try:\n            job = get_and_lock_job('IMAGE_TEST')\n            if job:\n                logger.info(f"成功获取作业: ID={job['id']}, 提示词={job['prompt_text']}")\n                return job\n            else:\n                logger.info("没有可用的测试图像作业")\n                return None\n        except Exception as e:\n            logger.error(f"获取作业失败: {e}")\n            raise\n    \n    @task(task_id='generate_image_task')\n    def generate_image_task(job_data, **context):\n        """生成测试图像"""\n        if not job_data:\n            logger.info("跳过图像生成，没有可用作业")\n            return None\n        \n        try:\n            job_id = job_data['id']\n            prompt_text = job_data['prompt_text']\n            \n            # 从DAG参数获取dry_run设置\n            dry_run_value = context['params'].get('dry_run', True)\n            logger.info(f"开始生成图像，作业ID: {job_id}, Dry Run模式: {dry_run_value}")\n            \n            # 生成图像（传递dry_run参数）\n            local_path = image_generator.generate_test_image_and_save(\n                prompt_text, \n                dry_run=dry_run_value\n            )\n            \n            mode_text = "DRY RUN" if dry_run_value else "REAL"\n            logger.info(f"{mode_text}图像生成完成，保存路径: {local_path}")\n            \n            return {\n                'job_id': job_id,\n                'local_path': local_path,\n                'prompt_text': prompt_text,\n                'dry_run': dry_run_value\n            }\n            \n        except Exception as e:\n            logger.error(f"图像生成失败: {e}")\n            # 标记作业为失败\n            if job_data:\n                mark_job_as_failed(job_data['id'], str(e))\n            raise\n    \n    @task(task_id='finalize_job_task')\n    def finalize_job_task(generation_result):\n        """完成作业处理"""\n        if not generation_result:\n            logger.info("跳过作业完成，没有生成结果")\n            return "跳过完成"\n        \n        try:\n            job_id = generation_result['job_id']\n            local_path = generation_result['local_path']\n            dry_run = generation_result.get('dry_run', True)\n            \n            # 标记作业为完成\n            success = mark_job_as_completed(job_id, local_path)\n            \n            if success:\n                mode_text = "DRY RUN" if dry_run else "REAL"\n                logger.info(f"作业 {job_id} 已成功完成 ({mode_text}模式)")\n                return f"作业 {job_id} 完成 ({mode_text}模式)"\n            else:\n                logger.error(f"无法标记作业 {job_id} 为完成")\n                raise Exception(f"无法标记作业 {job_id} 为完成")\n                \n        except Exception as e:\n            logger.error(f"完成作业失败: {e}")\n            raise\n    \n    @task(task_id='cleanup_test_files')\n    def cleanup_test_files():\n        """清理旧的测试文件"""\n        try:\n            cleaned_count = image_generator.cleanup_test_files(max_age_hours=24)\n            logger.info(f"清理了 {cleaned_count} 个测试文件")\n            return f"清理了 {cleaned_count} 个文件"\n        except Exception as e:\n            logger.error(f"清理测试文件失败: {e}")\n            raise\n    \n    # 定义任务流程\n    init_db = initialize_database()\n    job_data = get_job_task()\n    generation_result = generate_image_task(job_data)\n    finalize_result = finalize_job_task(generation_result)\n    cleanup = cleanup_test_files()\n    \n    # 设置任务依赖\n    init_db >> job_data >> generation_result >> finalize_result\n    cleanup  # 清理任务可以独立运行\n\n# 创建DAG实例\ntest_dag = test_image_generation_dag() 
34617681906255382	/opt/airflow/dags/veo_video_generation_dag.py	2025-07-21 08:43:37.383376+00	"""\n企业级Veo视频生成DAG\n实现健壮的、支持恢复式重试的视频生成工作流\n"""\nfrom datetime import datetime, timedelta\nfrom airflow.decorators import dag, task\nimport logging\nimport sys\nimport os\n\n# 添加src目录到Python路径\nsys.path.append('/opt/airflow/src')\n\nlogger = logging.getLogger(__name__)\n\n@dag(\n    dag_id='veo_video_generation_workflow',\n    description='企业级Veo视频生成工作流',\n    start_date=datetime(2024, 1, 1),\n    schedule=None,  # 手动触发\n    catchup=False,\n    tags=['veo', 'video-generation', 'enterprise'],\n    default_args={\n        'owner': 'ai-team',\n        'depends_on_past': False,\n        'email_on_failure': False,\n        'email_on_retry': False,\n        'retries': 2,\n        'retry_delay': timedelta(minutes=5),\n    }\n)\ndef veo_video_generation_workflow():\n    """企业级视频生成工作流"""\n\n    # 在DAG函数内部导入模块\n    try:\n        from core_workflow import (\n            get_and_lock_job, mark_job_as_completed, mark_job_as_failed,\n            update_job_operation_info, mark_job_as_awaiting_retry,\n            get_job_by_id, update_job_gcs_uri\n        )\n        from gen_video import submit_veo_generation_task, poll_veo_operation_status\n        from database import db_manager\n    except ImportError as e:\n        logger.error(f"导入模块失败: {e}")\n        raise\n\n    @task(task_id='initialize_database')\n    def initialize_database():\n        """初始化数据库连接"""\n        try:\n            db_manager.init_database()\n            logger.info("数据库初始化完成")\n            return "database_ready"\n        except Exception as e:\n            logger.error(f"数据库初始化失败: {e}")\n            raise\n\n    @task(task_id='get_job_task')\n    def get_job_task():\n        """获取待处理的VIDEO_PROD作业"""\n        try:\n            job = get_and_lock_job('VIDEO_PROD')\n            if job:\n                logger.info(f"获取到作业: ID={job['id']}, 提示词={job['prompt_text'][:50]}...")\n                return job\n            else:\n                logger.info("没有找到可用的VIDEO_PROD作业")\n                return None\n        except Exception as e:\n            logger.error(f"获取作业失败: {e}")\n            raise\n\n    @task(task_id='submit_job_task')\n    def submit_job_task(job_data):\n        """提交视频生成任务"""\n        if not job_data:\n            logger.info("跳过提交，没有可用作业")\n            return None\n\n        try:\n            job_id = job_data['id']\n            prompt_text = job_data['prompt_text']\n            is_retry = job_data.get('is_retry', False)\n\n            logger.info(f"处理作业 {job_id}，重试模式: {is_retry}")\n            logger.info(f"使用提示词: {prompt_text}")\n\n            if is_retry:\n                # 恢复模式：检查是否已有operation_id\n                job_info = get_job_by_id(job_id)\n                if job_info and job_info.get('operation_id'):\n                    logger.info(f"恢复模式：使用现有operation_id: {job_info['operation_id']}")\n                    return {\n                        'job_id': job_id,\n                        'prompt_text': prompt_text,\n                        'operation_id': job_info['operation_id'],\n                        'mode': 'resume'\n                    }\n                else:\n                    logger.warning("恢复模式但未找到operation_id，转为新提交模式")\n\n            # 新提交模式\n            logger.info("新提交模式：提交视频生成任务")\n            try:\n                operation_id = submit_veo_generation_task(prompt_text)\n\n                # 更新数据库中的operation_id\n                success = update_job_operation_info(job_id, operation_id)\n                if not success:\n                    logger.error(f"无法更新作业 {job_id} 的operation_id")\n                    raise Exception("数据库更新失败")\n\n                logger.info(f"提交成功，operation_id: {operation_id}")\n                return {\n                    'job_id': job_id,\n                    'prompt_text': prompt_text,\n                    'operation_id': operation_id,\n                    'mode': 'submit'\n                }\n\n            except Exception as e:\n                logger.error(f"提交失败: {e}")\n                mark_job_as_failed(job_id, str(e))\n                raise\n\n        except Exception as e:\n            logger.error(f"提交任务失败: {e}")\n            raise\n\n    @task(task_id='poll_job_task', execution_timeout=timedelta(minutes=20))\n    def poll_job_task(submit_result):\n        """轮询视频生成状态（20分钟超时）"""\n        if not submit_result:\n            logger.info("跳过轮询，没有提交结果")\n            return None\n\n        try:\n            job_id = submit_result['job_id']\n            operation_id = submit_result['operation_id']\n            mode = submit_result['mode']\n\n            logger.info(f"开始轮询作业 {job_id}，operation_id: {operation_id}，模式: {mode}")\n\n            try:\n                # 轮询视频生成状态\n                gcs_uri = poll_veo_operation_status(operation_id)\n\n                # 关键要求：重新查询数据库获取最新的gcs_uri\n                logger.info("轮询成功，重新查询数据库确认最新状态")\n\n                # 更新数据库中的GCS URI\n                success = update_job_gcs_uri(job_id, gcs_uri)\n                if success:\n                    # 从数据库重新获取最新信息\n                    updated_job = get_job_by_id(job_id)\n                    if updated_job:\n                        final_gcs_uri = updated_job['gcs_uri']\n                        logger.info(f"从数据库确认最终GCS URI: {final_gcs_uri}")\n\n                        return {\n                            **submit_result,\n                            'status': 'poll_completed',\n                            'gcs_uri': final_gcs_uri\n                        }\n                    else:\n                        logger.error(f"无法从数据库获取作业 {job_id} 的最新信息")\n                        raise Exception("数据库查询失败")\n                else:\n                    logger.error(f"无法更新作业 {job_id} 的GCS URI")\n                    raise Exception("数据库更新失败")\n\n            except Exception as poll_error:\n                # 轮询失败/超时，更新状态为awaiting_manual_retry\n                logger.error(f"轮询失败或超时: {poll_error}")\n                mark_job_as_awaiting_retry(job_id)\n                logger.info(f"作业 {job_id} 已标记为等待手动重试")\n                raise\n\n        except Exception as e:\n            logger.error(f"轮询任务失败: {e}")\n            raise\n\n    @task(task_id='finalize_job_task')\n    def finalize_job_task(poll_result):\n        """完成作业处理"""\n        if not poll_result:\n            logger.info("跳过作业完成，没有轮询结果")\n            return "跳过完成"\n\n        try:\n            job_id = poll_result['job_id']\n            gcs_uri = poll_result['gcs_uri']\n\n            # 标记作业为完成\n            success = mark_job_as_completed(job_id, gcs_uri=gcs_uri)\n\n            if success:\n                logger.info(f"作业 {job_id} 已成功完成，GCS URI: {gcs_uri}")\n                return f"作业 {job_id} 完成"\n            else:\n                # 检查是否已经完成\n                current_job = get_job_by_id(job_id)\n                if current_job and current_job['status'] == 'completed':\n                    logger.info(f"作业 {job_id} 已经处于完成状态")\n                    return f"作业 {job_id} 已完成"\n                else:\n                    logger.error(f"无法标记作业 {job_id} 为完成")\n                    raise Exception(f"无法标记作业 {job_id} 为完成")\n\n        except Exception as e:\n            logger.error(f"完成作业失败: {e}")\n            raise\n\n    # 定义任务流程\n    init_db = initialize_database()\n    job_data = get_job_task()\n    submit_result = submit_job_task(job_data)\n    poll_result = poll_job_task(submit_result)\n    finalize_result = finalize_job_task(poll_result)\n\n    # 设置任务依赖\n    init_db >> job_data >> submit_result >> poll_result >> finalize_result\n\n# 实例化DAG\nveo_video_generation_dag = veo_video_generation_workflow()
52857970949920226	/opt/airflow/dags/download_workflow_dag.py	2025-07-21 12:23:45.514686+00	#!/usr/bin/env python3\n"""\n下载工作流DAG - 异步下载生成的文件\n"""\n\nfrom datetime import datetime, timedelta\nfrom airflow import DAG\nfrom airflow.decorators import task\nfrom airflow.operators.python import PythonOperator\nfrom airflow.operators.bash import BashOperator\nimport os\nimport sys\nimport asyncio\nimport logging\n\n# 添加src目录到Python路径\nsys.path.insert(0, '/opt/airflow/src')\n\nfrom job_manager import JobManager\nfrom downloader import file_downloader\n\n# 设置日志\nlogging.basicConfig(level=logging.INFO)\nlogger = logging.getLogger(__name__)\n\n# DAG默认参数\ndefault_args = {\n    'owner': 'ai-team',\n    'depends_on_past': False,\n    'start_date': datetime(2025, 1, 1),\n    'email_on_failure': False,\n    'email_on_retry': False,\n    'retries': 2,\n    'retry_delay': timedelta(minutes=5),\n}\n\n# 创建DAG\ndag = DAG(\n    'download_workflow',\n    default_args=default_args,\n    description='异步下载生成的文件',\n    schedule_interval=timedelta(minutes=5),  # 每5分钟检查一次\n    catchup=False,\n    max_active_runs=1,\n    params={\n        "file_type": "all",  # 文件类型过滤: image/video/all\n        "max_downloads": 10,  # 每次最大下载数量\n        "priority_threshold": 0,  # 优先级阈值\n        "force_redownload": False,  # 强制重新下载\n    }\n)\n\n@task(task_id="scan_download_queue")\ndef scan_download_queue(**context) -> dict:\n    """扫描下载队列，获取待下载任务"""\n    \n    # 获取DAG参数\n    params = context.get('params', {})\n    file_type = params.get('file_type', 'all')\n    max_downloads = params.get('max_downloads', 10)\n    priority_threshold = params.get('priority_threshold', 0)\n    \n    logger.info(f"扫描下载队列，文件类型: {file_type}, 最大数量: {max_downloads}")\n    \n    job_manager = JobManager()\n    \n    # 获取待下载任务\n    filter_type = None if file_type == 'all' else file_type\n    pending_downloads = job_manager.get_pending_downloads(\n        limit=max_downloads, \n        file_type=filter_type\n    )\n    \n    # 过滤优先级\n    filtered_downloads = [\n        task for task in pending_downloads \n        if task['priority'] >= priority_threshold\n    ]\n    \n    logger.info(f"找到 {len(filtered_downloads)} 个待下载任务")\n    \n    return {\n        'download_tasks': filtered_downloads,\n        'total_count': len(filtered_downloads),\n        'file_type_filter': file_type\n    }\n\n@task(task_id="prepare_download_batch")\ndef prepare_download_batch(scan_result: dict, **context) -> dict:\n    """准备下载批次"""\n    \n    download_tasks = scan_result['download_tasks']\n    \n    if not download_tasks:\n        logger.info("没有待下载的任务")\n        return {\n            'has_downloads': False,\n            'batch_info': {}\n        }\n    \n    # 按优先级和文件类型分组\n    image_tasks = []\n    video_tasks = []\n    \n    for task in download_tasks:\n        if task['file_type'] == 'image':\n            image_tasks.append(task)\n        elif task['file_type'] == 'video':\n            video_tasks.append(task)\n    \n    # 构建下载批次\n    batch_info = {\n        'image_tasks': image_tasks,\n        'video_tasks': video_tasks,\n        'total_images': len(image_tasks),\n        'total_videos': len(video_tasks),\n        'estimated_duration': estimate_download_time(download_tasks)\n    }\n    \n    logger.info(f"准备下载批次 - 图像: {len(image_tasks)}, 视频: {len(video_tasks)}")\n    \n    return {\n        'has_downloads': True,\n        'batch_info': batch_info\n    }\n\ndef estimate_download_time(tasks: list) -> int:\n    """估算下载时间（秒）"""\n    # 简单估算：图像5秒，视频30秒\n    total_seconds = 0\n    for task in tasks:\n        if task['file_type'] == 'image':\n            total_seconds += 5\n        elif task['file_type'] == 'video':\n            total_seconds += 30\n    return total_seconds\n\n@task(task_id="download_images")\ndef download_images(batch_info: dict, **context) -> dict:\n    """下载图像文件"""\n    \n    logger.info(f"接收到的batch_info: {batch_info}")\n    \n    # 检查参数有效性\n    if not batch_info:\n        logger.warning("batch_info为None，尝试从数据库重新获取任务")\n        job_manager = JobManager()\n        pending_downloads = job_manager.get_pending_downloads(limit=10, file_type='image')\n        if pending_downloads:\n            image_tasks = pending_downloads\n            logger.info(f"从数据库获取到 {len(image_tasks)} 个图像下载任务")\n        else:\n            logger.info("跳过图像下载，没有任务")\n            return {'downloaded': 0, 'failed': 0}\n    elif not batch_info.get('has_downloads', False):\n        logger.info("跳过图像下载，没有任务")\n        return {'downloaded': 0, 'failed': 0}\n    else:\n        image_tasks = batch_info['batch_info']['image_tasks']\n    \n    if not image_tasks:\n        logger.info("没有图像下载任务")\n        return {'downloaded': 0, 'failed': 0}\n    \n    logger.info(f"开始下载 {len(image_tasks)} 个图像文件")\n    \n    job_manager = JobManager()\n    downloaded = 0\n    failed = 0\n    \n    for task in image_tasks:\n        try:\n            # 更新状态为下载中\n            job_manager.update_download_status(task['id'], 'downloading')\n            \n            # 执行下载\n            result = file_downloader.download_file_sync(\n                task['remote_url'], \n                task['local_path'],\n                resume=True\n            )\n            \n            if result['success']:\n                # 更新为完成状态\n                job_manager.update_download_status(\n                    task['id'], \n                    'completed',\n                    file_size=result['file_size']\n                )\n                downloaded += 1\n                logger.info(f"图像下载成功: {task['local_path']}")\n            else:\n                # 更新为失败状态\n                job_manager.update_download_status(\n                    task['id'], \n                    'failed',\n                    error_message=result['error']\n                )\n                failed += 1\n                logger.error(f"图像下载失败: {result['error']}")\n        \n        except Exception as e:\n            job_manager.update_download_status(\n                task['id'], \n                'failed',\n                error_message=str(e)\n            )\n            failed += 1\n            logger.error(f"图像下载异常: {e}")\n    \n    logger.info(f"图像下载完成 - 成功: {downloaded}, 失败: {failed}")\n    \n    return {\n        'downloaded': downloaded,\n        'failed': failed,\n        'type': 'image'\n    }\n\n@task(task_id="download_videos")\ndef download_videos(batch_info: dict, **context) -> dict:\n    """下载视频文件"""\n    \n    logger.info(f"接收到的batch_info: {batch_info}")\n    \n    # 检查参数有效性\n    if not batch_info:\n        logger.warning("batch_info为None，尝试从数据库重新获取任务")\n        job_manager = JobManager()\n        pending_downloads = job_manager.get_pending_downloads(limit=10, file_type='video')\n        if pending_downloads:\n            video_tasks = pending_downloads\n            logger.info(f"从数据库获取到 {len(video_tasks)} 个视频下载任务")\n        else:\n            logger.info("跳过视频下载，没有任务")\n            return {'downloaded': 0, 'failed': 0}\n    elif not batch_info.get('has_downloads', False):\n        logger.info("跳过视频下载，没有任务")\n        return {'downloaded': 0, 'failed': 0}\n    else:\n        video_tasks = batch_info['batch_info']['video_tasks']\n    \n    if not video_tasks:\n        logger.info("没有视频下载任务")\n        return {'downloaded': 0, 'failed': 0}\n    \n    logger.info(f"开始下载 {len(video_tasks)} 个视频文件")\n    \n    job_manager = JobManager()\n    downloaded = 0\n    failed = 0\n    \n    for task in video_tasks:\n        try:\n            # 更新状态为下载中\n            job_manager.update_download_status(task['id'], 'downloading')\n            \n            # 执行下载（视频文件通常较大，使用更长超时）\n            result = file_downloader.download_file_sync(\n                task['remote_url'], \n                task['local_path'],\n                resume=True\n            )\n            \n            if result['success']:\n                # 更新为完成状态\n                job_manager.update_download_status(\n                    task['id'], \n                    'completed',\n                    file_size=result['file_size']\n                )\n                downloaded += 1\n                logger.info(f"视频下载成功: {task['local_path']}")\n            else:\n                # 更新为失败状态\n                job_manager.update_download_status(\n                    task['id'], \n                    'failed',\n                    error_message=result['error']\n                )\n                failed += 1\n                logger.error(f"视频下载失败: {result['error']}")\n        \n        except Exception as e:\n            job_manager.update_download_status(\n                task['id'], \n                'failed',\n                error_message=str(e)\n            )\n            failed += 1\n            logger.error(f"视频下载异常: {e}")\n    \n    logger.info(f"视频下载完成 - 成功: {downloaded}, 失败: {failed}")\n    \n    return {\n        'downloaded': downloaded,\n        'failed': failed,\n        'type': 'video'\n    }\n\n@task(task_id="update_download_stats")\ndef update_download_stats(image_result: dict, video_result: dict, **context) -> dict:\n    """更新下载统计信息"""\n    \n    total_downloaded = image_result['downloaded'] + video_result['downloaded']\n    total_failed = image_result['failed'] + video_result['failed']\n    \n    logger.info(f"本次下载统计 - 总成功: {total_downloaded}, 总失败: {total_failed}")\n    \n    # 获取整体统计\n    job_manager = JobManager()\n    stats = job_manager.get_download_stats()\n    \n    logger.info(f"整体下载统计: {stats}")\n    \n    return {\n        'current_batch': {\n            'images_downloaded': image_result['downloaded'],\n            'images_failed': image_result['failed'],\n            'videos_downloaded': video_result['downloaded'],\n            'videos_failed': video_result['failed'],\n            'total_downloaded': total_downloaded,\n            'total_failed': total_failed\n        },\n        'overall_stats': stats\n    }\n\n@task(task_id="cleanup_old_records")\ndef cleanup_old_records(**context) -> dict:\n    """清理旧的下载记录"""\n    \n    job_manager = JobManager()\n    \n    # 清理7天前的已完成下载记录\n    cleaned_count = job_manager.cleanup_old_downloads(days=7)\n    \n    logger.info(f"清理了 {cleaned_count} 条旧下载记录")\n    \n    return {'cleaned_records': cleaned_count}\n\n# 定义任务依赖关系\nwith dag:\n    scan_result = scan_download_queue()\n    batch_info = prepare_download_batch(scan_result)\n\n    # 并行下载图像和视频\n    image_result = download_images(batch_info)\n    video_result = download_videos(batch_info)\n\n    # 更新统计和清理\n    stats_result = update_download_stats(image_result, video_result)\n    cleanup_result = cleanup_old_records()\n\n    # 设置依赖关系\n    scan_result >> batch_info >> [image_result, video_result] >> stats_result >> cleanup_result 
